import re

with open('aoc_15_19.txt', 'r') as f:
    raw = f.read()

element_finder = re.compile("[A-Z][a-z]*")

inputs, molecule = raw.strip().split("\n\n")
instructions = [x.split(" => ") for x in inputs.split("\n")]

results = set()

elements = element_finder.findall(molecule)
    
